import logo from './logo.svg';
import './App.css';

function App() {






  return (
    <div className="App">
      <header className="App-header">
        Sunrise Avenue Solar Energy Production Forecast!
        <img src={logo} className="App-logo" alt="logo" />
        <form action="/url" method="GET">
          <p>Please enter longitude and latitude of your location</p>
          <input type="text" name="Langitude" placeholder="Langitude" required></input>
          <br></br>
          <input type="text" name="Longitude" placeholder="Longitude" required></input>
          <br></br>
          <button type="submit">Get Results</button>
        </form>
      </header>
      <body>
        <p>
          AI Venture Project Livia Fries, Anne-Sophie Hannes, Philip Nag and Antonious Strauch 
        </p>
      </body>

    </div>
  );
}

export default App;
